import React from "react";

function NotFound() {
  return (
    <div className="container">
      <h1>Not found!</h1>
      <p>This page does not exist.</p>
      <p>Please return to the <Link to="/">Home page</Link>.</p>
    </div>
  );
}

export default NotFound;
